import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <h1><Link to="/">EcoCommerce</Link></h1>
      <nav>
        <Link to="/cart">Cart</Link>
        <Link to="/profile">Profile</Link>
      </nav>
    </header>
  );
}
export default Header;
